      // Create the output directory.\n        Directory.CreateDirectory(packagePath);\n\n        var overrideLayer = MyMapView.Map.OperationalLayers[3] as FeatureLayer;\n        _ = OnDemandMap(packagePath, overrideLayer);\n    }\n\n    private async void CancelJobButton_Click(object sender, Microsoft.UI.Xaml.RoutedEventArgs e)\n    {\n        // The user canceled the job.\n        await _offlineMapJob.CancelAsync();\n    }\n}')),(0,r.mdx)(o,{c:"sdk == 'android'",mdxType:"If"},(0,r.mdx)("pre",null,(0,r.mdx)("code",{parentName:"pre",className:"language-java"},"//Create a task from a map\nofflineMapTask = new OfflineMapTask(map);\n\n//or from an online map's portal item\nofflineMapTask = new OfflineMapTask(portalItem);\n")))),(0,r.mdx)(o,{c:n.examineWebMapCapabilities,mdxType:"If"},(0,r.mdx)("p",null,"You should check which layers and tables in the web map can be taken offline by examining the web map's offline capabilities. This can help identify layers or tables that are missing in the offline map that is generated."),(0,r.mdx)("p",null,"Get the ",(0,r.mdx)(o,{c:"sdk == 'ios'",mdxType:"If"},(0,r.mdx)(i.Z,{OfflineMapCapabilities_ios:!0,mdxType:"APITypeMemberNames"})),(0,r.mdx)(o,{c:"sdk == 'net'",mdxType:"If"},(0,r.mdx)(i.Z,{OfflineMapCapabilities_net:!0,mdxType:"APITypeMemberNames"})),(0,r.mdx)(o,{c:"sdk == 'android'",mdxType:"If"},(0,r.mdx)(i.Z,{OfflineMapCapabilities_android:!0,mdxType:"APITypeMemberNames"})),(0,r.mdx)(o,{c:"sdk == 'java'",mdxType:"If"},(0,r.mdx)(i.Z,{OfflineMapCapabilities_java:!0,mdxType:"APITypeMemberNames"})),(0,r.mdx)(o,{c:"sdk == 'qt'",mdxType:"If"},(0,r.mdx)(i.Z,{OfflineMapCapabilities_qt:!0,mdxType:"APITypeMemberNames"}))," object by calling the ",(0,r.mdx)(o,{c:"sdk == 'ios'",mdxType:"If"},(0,r.mdx)("inlineCode",{parentName:"p"},"getOfflineMapCapabilities")),(0,r.mdx)(o,{c:"sdk == 'android'",mdxType:"If"},(0,r.mdx)("inlineCode",{parentName:"p"},"getOfflineMapCapabilitiesAsync"))," ",(0,r.mdx)(o,{c:"sdk == 'java'",mdxType:"If"},(0,r.mdx)(